  // }

  const test = openOrClosed;

  const toggleMenu = (openOrClosed) => {
    console.log("worked");
    console.log(openOrClosed);
    if (openOrClosed) {
      return "slide-menu open";
    } else {
      return "slide-menu";
    }
  };

  const testGo = toggleMenu();

  return <div className={testGo}>SlideMenu</div>;
};

